import styled from 'styled-components'

const TimeDay = styled.div`
    display: flex;
    width: 320px;
    height: 100px;
    background-color: red;
    margin-top: 150px;
`

export default function DayTime(){
    return(
        <TimeDay></TimeDay>
    )
}
